script: |
  super -f text -I q4733.spq | sort > q4733.out

inputs:
  - name: q4733.spq
    data: |
      SELECT DISTINCT col0, - col1 FROM tab2 (FORMAT parquet) WHERE NOT CAST ( - col2 AS INTEGER ) + col0 NOT IN ( - + col0 / + col1 + 18 * 3, - col1 / - col2 * - 56 );
  - name: tab2

outputs:
  - name: q4733.out
    data: |
